    def isGood(n):
        count = 0
        while n:
            if n % 3 == 0:
                return False
            count += 1
            n //= 3
        return count >= 3

    def isSmaller(a, b):
        while a >= b:
            a -= b
        return a < 0

    def next(n):
        while True:
            if isGood(n):
                return n
            n += 1
            if isSmaller(n, n // 3):
                n *= 3
                n -= n // 3

    return " ".join([str(next(int(x))) for x in stdin.split()])

