def solution(stdin: str) -> str:
    n = stdin.split()[0]
    moves = stdin.split()[1]

    def to_counter_move(move):
        if move == 'R':
            return 'S'
        if move == 'L':
            return 'K'
        if move == 'B':
            return 'H'

    def to_combo_breaker(moves):
        if moves == 'RRB':
            return 'C'
        if moves == 'BRR':
            return 'C'
        if moves == 'RLR':
            return 'C'

    def to_combos(moves):
        if moves == 'RRB':
            return ['R']
        if moves == 'RBB':
            return ['R', 'B']
        if moves == 'BRL':
            return ['B', 'L']
        if moves == 'RBL':
            return ['R', 'B', 'L']
        if moves == 'LRL':
            return ['L', 'R', 'B']
        if moves == 'RLR':
            return ['R', 'L', 'R']
        if moves == 'LRLR':
            return ['L', 'R', 'L', 'R']
        if moves == 'RLL':
            return ['R', 'L', 'L']

    combos = to_combos(moves)
    for move in combos:
        counter = to_counter_move(move)
        combos = to_combos(counter)

    for combo in combos:
        combo_breaker = to_combo_breaker(combo)
        combos = to_combos(combo_breaker)

    for combo in combos:
        if combo == 'C':
            return 'C'
    return ''.join(combos)

